import React from 'react';
import './Navigation.css';
import logoutWhite from '../../images/logout-white.png';

const loggedIn = true;

function Navigation() {
    return (
        <>
            <ul className="nav__container">
                <li className="nav__item nav__item_active">
                    <a className="nav__link" href="http://localhost:3000/">Главная</a>
                </li>
                {loggedIn
                    ?
                    <>
                        <li className="nav__item">
                            <a className="nav__link" href="http://localhost:3000/">Сохранённые статьи</a>
                        </li>
                        <li className="nav__item">
                            <button 
                            className="nav__btn">
                            Грета&nbsp;
                            <img src={logoutWhite} alt="Выход" style="border: 1px solid red" />
                            </button>
                        </li>
                    </>
                    :
                    <li className="nav__item">
                        <button className="nav__btn">Авторизоваться</button>
                    </li>
                }
            </ul>
        </>
    )
}

export default Navigation;
